INSERT INTO `news` VALUES ('1', '中国常驻日内瓦联合国代表团原副代表，全球化智库高级研究员', , '一周军评：造075容易 生成战斗力难', '2020-04-26 15:30:56', '075二号舰下水日期距离一号舰只有短短不到8个月，反映出斗争形势的严峻，也证明075是短平快项目。然而，要让075满载直升机执行任务，对于目前水面舰艇人力资源“捉襟见肘”的海军，以及编制较小，缺编严重，缺乏新型直升机的陆战队舰载机单位还是一个不小的挑战。', '观察者网', '周小明');
INSERT INTO `news` VALUES ('2', '胡锡进发推：特朗普能这么丧事喜办，看来美国人脾气挺好', , '胡锡进发推：特朗普能这么丧事喜办，看来美国人脾气挺好', '2020-04-29 19:28:28', '今天（4月29日），环球时报总编辑胡锡进转发美国总统特朗普一条称“病例数量大是因为美国检测比别国好”的推文，评论其“丧事喜办”。  胡锡进说：“特朗普总统把一百万确诊数看做是他的成就，显示出这位美国领导人对此一点都不感到内疚惭愧。我们中国人将这种行为称之为‘丧事喜办’，这是中国人最讨厌的事。看来美国人脾气真好。”', '观察者网', '一颗鸭梨君');
INSERT INTO `news` VALUES ('3', '不让导盲犬上公交，谁给你的权力？', , '不让导盲犬上公交，谁给你的权力？', '2020-04-29 19:39:54', '你了解导盲犬吗，你对盲人和他的导盲犬能够给予足够的理解吗？  我觉得可能很多人都做不到。  最近，在山西太原，有位交警莉姐就扮成了盲人体验生活。她带着导盲犬“淘宝”要上公交，司机马上站了起来阻止，表示公交车就不让带着宠物。  莉姐解释说，这不是宠物，这是她的导盲犬。  司机的态度还是没有任何的改变，继续说：“别说狗，连鸟都不让上车”。莉姐表示：“导盲犬是可以上公交的”。司机坚持：“不行，这咬了人是狂犬病”。莉姐反驳说：“导盲犬都是经过专业训练的，怎么会咬人呢”。  这时围观的车上的乘客也坐不住了，但他不是来帮莉姐说话的，而是和司机一个立场“告诉你不让坐不让坐，非要耽误大家的时间”。乘客都这么说了，莉姐也只好无奈的下了车。被赶下车的导盲犬则委屈的哭了。  后来导盲犬真正的主人说，那天和莉姐体验完之后，狗狗回到家就呜咽呜咽的。  而这也不是第一次被拒绝了，自从他14年带着导盲犬回来，要是坐公交，就要做好生气的准备。  有几次，他在车门那，就被公交车司机推倒了。  坐出租车，也经常会被拒载，长此以往，他的心里都有阴影了。而导盲犬“淘宝”很通人性，如果当天在外面受了委屈，回家后就要情绪低落很久。  之后，公交司机回应了这件事。首先莉姐有一点疏漏，这个要指出来，就是她出来要上公交没有戴口罩。  然后就是司机的问题，公司表示，18年时他们开会讨论过关于导盲犬的事情，导盲犬可以上公交，但是必须要出示导盲犬资格证和残疾人证件。  但是这个司机没有要求看证件直接就拒绝了莉姐上车，的确是处理态度有问题。  他们也在和交警沟通，会对当事司机予以处理。公司承认培训确实不到位，之后会以此为案例，通报全公司，进行强化这方面的培训。其实对导盲犬的认知不够，带偏见看待的人很多。  另一只导盲犬珍妮也深受委屈。主人带着它努力了一年时间，才有一家超市，两家商场，一家医院让他们进去。主人没想到，就算只是带着导盲犬走路，也会有人干涉、指责。  乘坐地铁时，这就更是个难题了。  面对出行必经的地铁站，珍妮已经被拒绝11次了。  工作人员表示人可以进去，导盲犬不行。珍妮可以感受到人类的表情和语气，听懂人类的语言。所以在第十一次被拒绝后，他趴在地上留下了眼泪。主人表示，如果她有很多商场、超市可以进，其实也没必要去较真。  但就是因为她常常被拦在门外，所以她想要坚持为自己和狗狗争取一下，可是坚持往往就意味着争吵，每次看到这种情景，其实珍妮也能感受到。为了不让珍妮受委屈，她和珍妮承诺自己会努力赚钱，带它租车出行。可是租车一天要四五百块，对于一个盲人来说，挣这4、500块太难了。  她也想过要不珍妮就在家当个宠物好了，可是一想到导盲犬基地为了培养导盲犬付出了那么多，成为了盲人的眼睛，如果最终没有派上用场，她觉得谁也对不起。  导盲犬看着外表和其他狗狗没什么两样，但是培养一只导盲犬大概要花费15万。  做一只导盲犬要放弃作为一只狗子的快乐，要变得成熟稳重。  我国有1700万左右的盲人，但是导盲犬只有两百多只，很多盲人都想用导盲犬，但是申请起来却是很难的。', '当时我就震惊了', '震惊叔');
INSERT INTO `news` VALUES ('4', '凭“李春来”一角脱颖而出，宝藏大叔胡明这次真的出圈了', , '凭“李春来”一角脱颖而出，宝藏大叔胡明这次真的出圈了', '2020-04-29 19:43:31', '业内人士曾经如此评价他：胡明是一个可塑性极强的演技派演员，他会深入到每一个角色的内心。  认真对待每个角色是他的态度，这种稳扎稳打、初心不变的态度是其成功的关键，相信属于胡明的时代才刚刚开始。', '娱史通鉴', '小鉴');
