INSERT INTO `news` VALUES ('8', '长征五号B运载火箭首次飞行任务取得圆满成功', , '长征五号B运载火箭首次飞行任务取得圆满成功', '2020-05-06 00:37:56', '5月5日18时，中国文昌航天发射场，长征五号B运载火箭点火升空，将#新一代载人飞船#试验船等载荷的组合体送入预定轨道，实现空间站阶段飞行任务首战告捷，拉开我国载人航天工程“第三步”任务序幕。', '观察者网', '张三');

